/**
 * Inter font definition for jsPDF
 * 
 * SETUP INSTRUCTIONS:
 * 
 * QUICK START (Recommended):
 * 1. Run the download script: node scripts/download-inter-font.js
 *    This will download Inter-Regular.ttf and Inter-Bold.ttf to public/fonts/
 * 
 * 2. Convert fonts using jsPDF Font Converter:
 *    Visit: https://rawgit.com/MrRio/jsPDF/master/fontconverter/fontconverter.html
 *    OR: https://github.com/parallax/jsPDF/tree/master/fontconverter
 * 
 * 3. For each font file (Inter-Regular.ttf and Inter-Bold.ttf):
 *    - Upload the .ttf file to the converter
 *    - Download the generated JavaScript file
 *    - Open the generated file and copy the base64 string
 *    - Paste it in the corresponding variable below (INTER_REGULAR_BASE64 or INTER_BOLD_BASE64)
 * 
 * MANUAL ALTERNATIVE:
 * 1. Go to https://fonts.google.com/specimen/Inter
 * 2. Click "Download family" button
 * 3. Extract the zip file
 * 4. Use the TTF files from the extracted folder
 * 5. Follow steps 2-3 above
 * 
 * NOTE: The web app already uses Inter from Google Fonts (see src/app/layout.tsx)
 * This file is specifically for jsPDF which requires font files in base64 format.
 */

// Paste the base64 string from the font converter here:
// For Inter-Regular.ttf - Get this from the jsPDF font converter
const INTER_REGULAR_BASE64 = '';

// Paste the base64 string from the font converter here:
// For Inter-Bold.ttf - Get this from the jsPDF font converter
const INTER_BOLD_BASE64 = '';

/**
 * Register Inter font with jsPDF
 * Call this function before creating PDF content
 * 
 * @param {jsPDF} pdf - The jsPDF instance
 * @returns {boolean} - Returns true if font was registered, false otherwise
 */
export function registerInterFont(pdf) {
  try {
    // Check if base64 strings are still placeholders
    if (INTER_REGULAR_BASE64.includes('PASTE') || INTER_BOLD_BASE64.includes('PASTE')) {
      console.warn('Inter font not configured yet. Using Helvetica fallback.');
      console.warn('Please follow setup instructions in src/lib/inter-font.js');
      return false;
    }

    // Register Regular font
    if (INTER_REGULAR_BASE64) {
      // Use the filename that matches what the font converter generated
      pdf.addFileToVFS('Inter-normal.ttf', INTER_REGULAR_BASE64);
      pdf.addFont('Inter-normal.ttf', 'Inter', 'normal');
    }

    // Register Bold font
    if (INTER_BOLD_BASE64) {
      // Use the filename that matches what the font converter generated
      pdf.addFileToVFS('Inter-bold.ttf', INTER_BOLD_BASE64);
      pdf.addFont('Inter-bold.ttf', 'Inter', 'bold');
    }

    return true;
  } catch (error) {
    console.error('Error registering Inter font:', error);
    return false;
  }
}

/**
 * Get the font name to use in PDF
 * Returns 'Inter' if registered, 'helvetica' as fallback
 */
export function getInterFontName(pdf) {
  // Try to register font (will only register if base64 is available)
  const registered = registerInterFont(pdf);
  return registered ? 'Inter' : 'helvetica';
}

